import { useNavigate } from "react-router-dom";

const Profile = () => {
  const userInfo = useSelector(state=> state.userInfo)

  return (
    <div className="profile"> 
    <div>
      <a>{userInfo.username}</a>
      <a>{userInfo.bio}</a>
    </div>
    <button>Edit bio</button>

    </div>
  )
}

export default Profile
